var _module = _modules.uiModules.get('security', ['ngResource']);
_module.service('ApplicationPrivileges', function ($resource, chrome) {
  var baseUrl = chrome.addBasePath('/api/security/v1/privileges');
  return $resource(baseUrl, null, {
    query: {
      isArray: false
    }
  });
});
